ontent areas on every page</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Full compatibility with drag-and-drop page builders</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\";s:12:\"post-excerpt\";s:81:\"Inspire confidence in new clients with this clean and crisp construction template\";s:5:\"pages\";a:5:{s:8:\"id-68255\";a:12:{s:5:\"title\";s:5:\"About\";s:18:\"featured-image-url\";s:85:\"https://websitedemos.net/wp-content/uploads/2022/08/construction-company-08-about.jpg\";s:19:\"thumbnail-image-url\";s:94:\"https://websitedemos.net/wp-content/uploads/2022/08/construction-company-08-about-600x1664.jpg\";s:18:\"astra-page-api-url\";s:72:\"https://websitedemos.net/construction-company-08/wp-json/wp/v2/pages/499\";s:12:\"dynamic-page\";s:2:\"no\";s:14:\"astra-page-url\";s:49:\"//websitedemos.net/construction-company-08/about/\";s:15:\"astra-sites-tag\";a:0:{}s:15:\"site-pages-type\";s:4:\"free\";s:23:\"site-pages-page-builder\";s:9:\"gutenberg\";s:19:\"site-pages-category\";a:0:{}s:26:\"site-pages-parent-category\";a:2:{i:60;s:8:\"business\";i:61;s:4:\"free\";}s:16:\"required-plugins\";a:1:{i:0;a:3:{s:4:\"slug\";s:29:\"ultimate-addons-for-gutenberg\";s:4:\"init\";s:63:\"ultimate-addons-for-gutenberg/ultimate-addons-for-gutenberg.php\";s:4:\"name\";s:7:\"Spectra\";}}}s:8:\"id-68256\";a:12:{s:5:\"title\";s:7:\"Contact\";s:18:\"featured-image-url\";s:87:\"https://websitedemos.net/wp-content/uploads/2022/08/construction-company-08-contact.jpg\";s:19:\"thumbnail-image-url\";s:96:\"https://websitedemos.net/wp-content/uploads/2022/08/construction-company-08-contact-600x1495.jpg\";s:18:\"astra-page-api-url\";s:72:\"https://websitedemos.net/construction-company-08/wp-json/wp/v2/pages/501\";s:12:\"dynamic-page\";s:2:\"no\";s:14:\"astra-page-url\";s:51:\"//websitedemos.net/construction-company-08/contact/\";s:15:\"astra-sites-tag\";a:0:{}s:15:\"site-pages-type\";s:4:\"free\";s:23:\"site-pages-page-builder\";s:9:\"gutenberg\";s:19:\"site-pages-category\";a:0:{