(5, 1, '2023-03-03 02:15:27', '2023-03-03 02:15:27', '<p style=\"color:red;font-weight:bold;\">This page and the content has been automatically generated for you to give you a basic idea of how a \"Join Us\" page should look like. You can customize this page however you like it by editing this page from your WordPress page editor.</p><p style=\"font-weight:bold;\">If you end up changing the URL of this page then make sure to update the URL value in the settings menu of the plugin.</p><p style=\"border-top:1px solid #ccc;padding-top:10px;margin-top:10px;\"></p>\r\n			<strong>Free Membership</strong>\r\n			<br />\r\n			You get unlimited access to free membership content\r\n			<br />\r\n			<em><strong>Price: Free!</strong></em>\r\n			<br /><br />Link the following image to go to the Registration Page if you want your visitors to be able to create a free membership account<br /><br />\r\n			<img title=\"Join Now\" src=\"https://test.adilarham.com/wp-content/plugins/simple-membership/images/join-now-button-image.gif\" alt=\"Join Now Button\" width=\"277\" height=\"82\" />\r\n			<p style=\"border-bottom:1px solid #ccc;padding-bottom:10px;margin-bottom:10px;\"></p><p><strong>You can register for a Free Membership or pay for one of the following membership options</strong></p><p style=\"border-top:1px solid #ccc;padding-top:10px;margin-top:10px;\"></p>\r\n			[ ==> Insert Payment Button For Your Paid Membership Levels Here <== ]\r\n			<p style=\"border-bottom:1px solid #ccc;padding-bottom:10px;margin-bottom:10px;\"></p>', 'Join Us', '', 'publish', 'closed', 'closed', '', 'membership-join', '', '', '2023-03-03 02:15:27', '2023-03-03 02:15:27', '', 0, 'https://test.adilarham.com/membership-join/', 0, 'page', '', 0),
