(56, 'woocommerce_hpos_1st_notification_q2_2023', 'marketing', 'en_US', 'High-Performance Order Storage (HPOS) is on its way', 'Our team is targeting August 2023 to roll out a major database upgrade that can unlock faster checkout and order creation for your customers  and lightning-quick order lookup for you. Enablement is optional and you wont be forced to update, but read on to see why this was our most requested new feature.', '{}', 'unactioned', 'woocommerce.com', '2023-07-02 01:18:19', NULL, 0, 'plain', '', 0, 1, 'info'),
(57, 'woocommerce-WCOPC-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce One Page Checkout', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-07-02 01:18:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'wc-admin-wcpay-bulgaria-Q2-2023', 'marketing', 'en_US', 'WooCommerce Payments is now available in Bulgaria!', 'Weve recently released WooCommerce Payments in Bulgaria. You can view and manage transactions right in your WordPress dashboard while securely accepting major cards, Apple Pay, and payments in over 100 currencies.', '{}', 'pending', 'woocommerce.com', '2023-07-02 01:18:19', NULL, 0, 'plain', '', 0, 0, 'info'),
