(64, 'tiktok-spc_june-2023', 'marketing', 'en_US', 'Take the guesswork out of TikTok advertising', 'Save time and create smarter ads using new automated campaign management from TikTok for WooCommerce. Simplify your campaign creation and watch TikToks machine learning build, target, and optimize ads that support your advertising goals  and grow your audience.', '{}', 'unactioned', 'woocommerce.com', '2023-07-02 01:18:19', NULL, 0, 'plain', '', 0, 1, 'info'),
(65, 'wc-admin-test-checkout', 'info', 'en_US', 'Don\'t forget to test your checkout', 'Make sure that your checkout is working properly before you launch your store. Go through your checkout process in its entirety: from adding a product to your cart, choosing a shipping location, and making a payment.', '{}', 'actioned', 'woocommerce-admin', '2023-07-02 01:45:52', NULL, 0, 'plain', '', 0, 1, 'info'),
(66, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-03 03:07:43', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-03 03:07:43', NULL, 0, 'plain', '', 0, 0, 'info'),
(68, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ready to launch your store?', 'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-03 03:07:43', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-04 16:59:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(70, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-07-04 16:59:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(71, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage  July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-07-06 10:31:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(72, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Help WooCommerce improve with usage tracking', 'Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"https://test.adilarham.com/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Read more</a> about what data we collect.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-09 05:17:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(73, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-07-12 01:57:17', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'wc-admin-customize-store-with-blocks', 'info', 'en_US', 'Customize your online store with WooCommerce blocks', 'With our blocks, you can select and display products, categories, filters, and more virtually anywhere on your site  no need to use shortcodes or edit lines of code. Learn more about how to use each one of them.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-16 04:45:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'square_payments_q3_2023', 'marketing', 'en_US', 'Square for WooCommerce', 'Connect your Square account with WooCommerce to accept online and in-person payments (including contactless payments and cross-channel gift cards) quickly and securely. Save time by syncing sales, customers, and items and inventory  and manage everything through one centralized platform.', '{}', 'unactioned', 'woocommerce.com', '2023-07-20 12:13:41', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'wc-admin-woopayments-rebrand', 'marketing', 'en_US', 'WooCommerce Payments is now WooPayments', 'Weve changed the name as part of recent updates to the Woo brand. Youll still enjoy the same seamless payments experience  just look for WooPayments in your WordPress admin.', '{}', 'pending', 'woocommerce.com', '2023-07-29 05:08:14', NULL, 0, 'plain', '', 0, 0, 'info'),
(77, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-03 09:17:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(78, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-03 09:17:34', NULL, 0, 'plain', '', 0, 0, 'info'),
